import React from 'react';
import {
  Container,
  Divider,
  Dropdown,
  Grid,
  Header,
  Image,
  List,
  Menu,
  Segment,
} from 'semantic-ui-react'

const Blurb = () => {
	return (
	  <div>
	      <Image className='ui small left floated image' src={require('./test.png')} alt='mwuah' style={{ marginTop: '2em' }} />
	      <Header as='h1'>Pleasure to meet you! (o:</Header>
	      <p>An empathetic sponge striving to bridge people together through technology. I enjoy helping others accomplish their goals through project management and by doing my best to understand/discover their true needs.</p>
	      <p>
	        When I can I like to dance, read, and play 2nd Dad to my 4 younger siblings.
	      </p>
	      <hr />
	      <Header as='h4'>Latest Works</Header>
	      <hr />
	  </div>
	);
};

export default Blurb;
